import React from 'react';
// import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
// import NavigationMenu from './NavigationMenu';
// import { NavLinks } from 'react-router-dom';
import Logo from './Logo';
import Navigation from './Navigation';
import './Header.css';
import socialFacebook from '../assets/images/social-facebook.png';
import socialTwitter from '../assets/images/social-twitter.png';
import socialGoogleplus from '../assets/images/social-googleplus.png';
import socialInstagram from '../assets/images/social-instagram.png';
import searchIcon from '../assets/images/search-icon.png';
import userIcon from '../assets/images/user-icon.png';
import cartIcon from '../assets/images/cart-icon.png';

class Header extends React.Component {
	
	render(){
		return (
			<header>
				<div className = "row-wrap-header">
					<div className="container">
						<div className = "row">
							<div className="col-md-3 ">
								<div className= "contacts-header">
									<span>124213</span>
									<span>907707</span>
								</div>	
							</div>
							<div className = "col-md-2 offset-md-7">
								<ul className="social-links">
									<li><a href="" title="shopy in facebook"><img src={socialFacebook} /></a></li>
									<li><a href="/" title="shopy in twitter"><img src={socialTwitter} /></a></li>
									<li><a href="/" title="shopy in googleplus"><img src={socialGoogleplus} /></a></li>
									<li><a href="/" title="shopy in instagram"><img src={socialInstagram} /></a></li>
								</ul>
							</div>
						</div>
					</div>
				</div>
				<div className="row-wrap-header row-wrap-header_main">
					<div className="container">
						<div className = "row">	
							<div className="col-md-2">
								<Logo />
							</div>
							<div className="col-md-5">
								<nav className="header-navigation">
									<Navigation />
								</nav>
							</div>
							<div className="col-md-2 offset-md-3">
								<ul className="user-controls">
									<li><img src={searchIcon} /></li>
									<li><img src={userIcon} /></li>
									<li><img src={cartIcon} /></li>
								</ul>
							</div>
						</div>
					</div>
				</div>
			</header>
		)
	}
}

export default Header;
